import React, { useEffect } from "react";
import { useNavigate } from "react-router-dom";

import appPages from "../utils/pages.js";
import "./Timeline.css";

const Timeline = () => {
  const navigate = useNavigate(); // Initialize navigate hook
  useEffect(() => {
    // --------------Random page navigation start-------------------------------
    // Generate random time between 10 and 30 seconds
    const randomTime = Math.floor(Math.random() * (30000 - 10000 + 1)) + 10000;
    const randomPage = appPages[Math.floor(Math.random() * appPages.length)];
    const timer = setTimeout(() => {
      navigate(randomPage); // Navigate to the randomly selected page
    }, randomTime); 

    // --------------Random page navigation end-------------------------------

    const events = document.querySelectorAll(".event");
    const positions = []; // Store positions to check for overlaps

    events.forEach((event, index) => {
      setTimeout(() => {
        let randomX, randomY;
        let overlap;

        do {
          overlap = false;
          randomX = Math.random() * window.innerWidth * 1.5; // Horizontally up to 2 screen widths
          randomY = Math.random() * window.innerHeight * 3; // Vertically within half the screen height

          // Check for overlap with existing positions
          for (const pos of positions) {
            const [prevX, prevY] = pos;
            const eventWidth = event.offsetWidth;
            const eventHeight = event.offsetHeight;

            // Check for overlap
            if (
              randomX < prevX + eventWidth &&
              randomX + eventWidth > prevX &&
              randomY < prevY + eventHeight &&
              randomY + eventHeight > prevY
            ) {
              overlap = true; // Set overlap to true if there is an overlap
              break; // Exit the loop if an overlap is found
            }
          }
        } while (overlap); // Repeat until a non-overlapping position is found

        // Set the position and make the event visible
        event.style.transform = `translate(${randomX}px, ${randomY}px)`;
        event.style.opacity = 1; // Make the event visible
        positions.push([randomX, randomY]); // Store the position
      }, index * 1000); // Delay each event's movement by 1 second for a staggered effect
    });

    return () => {
      clearTimeout(timer); // clear random page navigation timeout
    };
  }, [navigate]);

  return (
    <div className="timeline">
      
      <div className="timeline-container">
      <button className="back-home-button" onClick={() => navigate("/")}>
        Back to Home
      </button>
        <h1 className="h1-timeline">Chaotic Timeline of Historical Events</h1>
        <div className="timeline">
          <div className="event">
            <img
              className="img-timeline"
              src="data:image/jpeg;base64,"
            />
            <br />
            The Big Bang
          </div>
          <div className="event">
            <img
              className="img-timeline"
              src="data:image/jpeg;base64,"
            />
            <br />
            Dinosaurs Roamed
          </div>
          <div className="event">
            <img
              className="img-timeline"
              src="data:image/jpeg;base64,"
            />
            <br />
            The Pyramids Were Built
          </div>
          <div className="event">
            <img
              className="img-timeline"
              src="data:image/jpeg;base64,"
            />
            <br />
            The Fall of Rome
          </div>
          <div className="event">
            <img
              className="img-timeline"
              src="data:image/jpeg;base64,"
            />
            <br />
            World War II
          </div>
          <div className="event">
            <img
              className="img-timeline"
              src="data:image/jpeg;base64,"
            />
            <br />
            First Moon Landing
          </div>
          <div className="event">
            <img
              className="img-timeline"
              src="data:image/jpeg;base64,"
            />
            <br />
            Internet Was Born
          </div>
          <div className="event">
            <img
              className="img-timeline"
              src="data:image/jpeg;base64,"
            />
            <br />
            COVID-19 Pandemic
          </div>
        </div>
      </div>
    </div>
  );
};

export default Timeline;
